import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='main'>
          <div className='main-nav'>
            <ul>
              <li>Welcome</li>
              <li>Contact</li>
              <li>About</li>
            </ul>


          </div>
          <div className="main-photo">
            <img src="./wedding.png" width="100" height="140"/>

          </div>

        </div>
      </header>
    </div>
  );
}

export default App;
